    function addItems(toRemove) {
        var itemsToRemove = ``;
        for (var i in toRemove) {
            var label = toRemove[i].label;
            var id = label.replace(/[\s]+/g, "");
            var selector = '';
            var checked = (toRemove[i].checked) ? " checked" : "";
            if (Array.isArray(toRemove[i].selector)) {
                for (var items in toRemove[i].selector) { selector += toRemove[i].selector[items] + ":not(.manuallySelected),"; }
                selector = selector.slice(0, 1);
            } else {
                selector = toRemove[i].selector;
            }
            itemsToRemove += `<li><input class='toggleChecks' id='show${id}' ${checked} data-toggle='${selector}' type='checkbox'> 
            <label for='show${id}'>${label}</label>
            </li>`;
        }
        return itemsToRemove;
    }

    function addSelectorToggle(selector) {
        if (selector) {
            $(selector).addClass('setForRemoval');
            $('#selectorToggleList').append(addItems([{ "selector": selector, "label": selector, "checked": false }]));
        }
        toggleMe.value = "";
    }
